import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Header from './Header';
function Doctor(){
    const [first,setFirst] = useState([]);
    useEffect(()=>{
        const fetchPatients= async () =>{
            try{
                const response = await axios.get('http://localhost:3000/en/getPatients');
                const data = response.data;
                setFirst(data);

            }catch(err){
                console.log(err);
            }
        }
        fetchPatients();
    },[])
    
    return(
        <div>
            <Header/>
            <div className='doctorpage'>
            <table>
                <thead>
                <tr>
                  <th>Patient Id</th>
                  <th>Name</th>
                  <th>Phone Number</th>
                  <th>Date Of Birth</th>
                  <th>Gender</th>
                  <th>Blood Group</th>
                </tr>
                </thead>
                <tbody>
                            {patientlist && patientlist.map((data) => (
                                <tr key={data._id} onClick={() => handlePatientClick(data._id)}  >
                                    {/* <th>{data.s_no}</th> */}
                                    <td>{data._id}</td>
                                    <td>{data.name}</td>
                                    {/* <td>{data.email}</td> */}
                                    <td>{data.phone}</td>
                                    <td>{formatDate(data.DOB)}</td>
                                    <td>{data.gender}</td>
                                    <td>{data.bloodGroup}</td>
                                </tr>
                            ))}
                        </tbody>

                
            </table>




            </div>

        </div>
    );
}
export default Doctor;
